import "./Nav.css";
const Navigation = (props) => {
  return (
    <>
      <div className="navbar">
        <div className="logo">{props.logoName}</div>
        <ul className="items">
          <li>Home</li>
          <li>Home</li>
          <li>Home</li>
        </ul>
      </div>
    </>
  );
};

export default Navigation;
